import React, { Component } from 'react';
import css from './Dashboard.module.css';
import GraphLayout from '../graphLayout/GraphLayout'


class DashBoard extends Component {
    render() {
        return (
            <>
                <h1>DashBoard</h1>
                <GraphLayout />
            </>
        );
    }
}

export default DashBoard;
